import React from "react";
import { createUseStyles } from "react-jss";
import clsx from "clsx";

const useStyles = createUseStyles({
  paging__list: {
    display: "flex",
    alignItems : "center",
    justifyContent : "center",
    gap : "1rem",
    border : "3px solid var(--background-color-header)",
  },
  paging__item: {
    width : "4.2rem",
    height : "4rem",
    display : "flex",
    alignItems : "center",
    justifyContent : "center",
    fontSize : "1.5rem",
    borderRadius: "1rem",
    backgroundColor: "var(--background-color-header)",
  },
});

export default function Paging({ data }) {
  const classes = useStyles();
  console.log(data);
  return (
      <div className={clsx(classes.paging__list)}>
      <div className={clsx(classes.paging__item, classes)}><ion-icon name="chevron-back"></ion-icon></div>

      <div className={clsx(classes.paging__item)}>2</div>
      <div className={clsx(classes.paging__item)}>2</div>
      <div className={clsx(classes.paging__item)}>2</div>

      <div className={clsx(classes.paging__item)}><ion-icon name="chevron-forward"></ion-icon></div>
    </div>
  );
}
